import React from 'react';
import Logo from './parlour-dev-logo-web.png';

const Navbar = () => {
    return (
        <div className="w-auto h-40 sm:h-20 bg-white rounded-2xl mx-4 my-4 drop-shadow-sm flex items-center sm:justify-between justify-center flex-col sm:flex-row">
            <img className="h-10 sm:ml-6" src={Logo} alt="Parlour Development Logo" />
            <div className="text-xl sm:mr-6 mt-6 sm:mt-0 font-sans">
                <span className="mx-4 sm:mr-6 font-bold w-auto h-auto p-2 bg-green-400">Projekty</span>
                <span className="mx-4 sm:mr-6 font-bold">Cennik</span>
                <span className="mx-4 font-bold">Kontakt</span>
            </div>
        </div>
    )
}

export default Navbar
